import { Box, Typography } from '@mui/material';

const About = () => {
  return (
    <Box
      sx={{
        px: 4,
        py: 2,
        borderBottom: '2px solid #f5f5dc', 
        color: '#f0f0f0', 
        ml:10,
        mr:10,
        pt:5,
      }}
    >
     
      <Box
        sx={{
          display: 'flex',
          justifyContent: 'space-between',
          alignItems: 'center',
          mb: 1,
        }}
      >
        <Typography variant="h3" fontWeight="bold"
           sx={{

          }}>
            Yakup <br />
            <Box component="span" sx={{ display: 'block', mt: 1 }}>
              ŞİMŞEK
            </Box>
          </Typography>
        <Box sx={{ display: 'flex', gap: 2 }}>
          <Box
            component="img"
            src="img1.webp"
            alt="Resim 1"
            sx={{ width: 300, height: 450, objectFit: 'cover' }}
          />
          <Box
            component="img"
            src="img1.webp"
            alt="Resim 2"
            sx={{ width: 300, height: 450, objectFit: 'cover' }}
          />
        </Box>
      </Box>

      {/* Alt satır */}
      <Box
        sx={{
          display: 'flex',
          justifyContent: 'space-between',
          alignItems: 'center',
          pt: 1,
        }}
      >
        <Typography variant="subtitle1">Alt Başlık</Typography>
        <Typography variant="body1" sx={{ maxWidth: '50%', textAlign: 'right' }}>
          Açıklama yazısı buraya gelecek.
        </Typography>
      </Box>
    </Box>
  );
};

export default About;
